import React, { useEffect, useState } from 'react'
import axios from 'axios'
import DogCard from './DogCard'

const Dogs = ({ breed }) => {
  const [dogs, setDogs] = useState([])
  const [ready, setReady] = useState(false)
  const DOGS_URL = `https://dog.ceo/api/breed/${breed}/images`

  useEffect(() => {
    const getDogs = async (url) => {
      const res = await axios.get(DOGS_URL)
      setDogs(res.data.message)
    }

    getDogs(DOGS_URL)
  }, [])

  return (
    <div className="dog_cards">
      {
        dogs.length > 0 && dogs.map(dog => {
          return <DogCard key={dog} img_url={dog} />
        })
      }
    </div>
  )
}

export default Dogs
